import React, { Component } from "react";
import "./App.css";
import Input from "./input/input";
import Upload from "./upload/Upload";

class App extends Component {
  render() {
    return (
      <div className="App">
        <div className="Card">
          <iframe
            id="iframepdf"
            src="/Users/admin/Downloads/Vysotskiy_CV.pdf"
          ></iframe>
        </div>
        <div className="Card">
          <Upload />
        </div>
        <div className="Card">
          <Input />
        </div>
      </div>
    );
  }
}

export default App;
